import React, { useState } from 'react';
import { useNavigate, Link } from 'react-router-dom';
import Navbar from '../components/Navbar';

export default function Signup() {
  const [credentials, setCredentials] = useState({ name: "", email: "", password: "", geolocation: "" });
  let navigate = useNavigate();

  const handleSubmit = async (e) => {
    e.preventDefault();
    console.log(JSON.stringify({ name: credentials.name, email: credentials.email, password: credentials.password, location: credentials.geolocation }));
    try {
      const response = await fetch("http://localhost:5000/api/createuser", {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json'
        },
        body: JSON.stringify({ name: credentials.name, email: credentials.email, password: credentials.password, location: credentials.geolocation })
      });
      const json = await response.json();
      console.log(json);
      if (!json.success) {
        alert("Enter valid Credentials");
      } else {
        // Navigate to login or another page upon successful signup
        navigate("/login");
      }
    } catch (error) {
      console.error("Error during fetch:", error);
      alert("An error occurred while creating the user. Please try again.");
    }
  }

  const onChange = (e) => {
    setCredentials({ ...credentials, [e.target.name]: e.target.value });
  }

  return (
    <>
      <Navbar />
      <div className="container mt-3">
        <form onSubmit={handleSubmit}>
          <div className="mb-3">
            <label htmlFor="name" className="form-label">Name</label>
            <input type="text" className="form-control" id="name" name="name" value={credentials.name} onChange={onChange} />
          </div>
          <div className="mb-3">
            <label htmlFor="email" className="form-label">Email address</label>
            <input type="email" className="form-control" id="email" name="email" value={credentials.email} onChange={onChange} />
          </div>
          <div className="mb-3">
            <label htmlFor="password" className="form-label">Password</label>
            <input type="password" className="form-control" id="password" name="password" value={credentials.password} onChange={onChange} />
          </div>
          <div className="mb-3">
            <label htmlFor="geolocation" className="form-label">Geolocation</label>
            <input type="text" className="form-control" id="geolocation" name="geolocation" value={credentials.geolocation} onChange={onChange} />
          </div>
          <button type="submit" className="btn btn-primary">Submit</button>
        </form>
        <p className="mt-2">
          Already have an account? <Link to="/login">Login</Link>
        </p>
      </div>
    </>
  );
}
